import React from 'react';

const PlusIcon = ({ className, width = 20, height = 20 }) => (
  <div 
    className={`plus-icon ${className || ''}`}
    style={{
      backgroundImage: "url('https://static.motiffcontent.com/private/resource/image/197f74679cbacc0-9188a548-da0b-4469-9273-a17c882a510d.svg')",
      width: `${width}px`,
      height: `${height}px`,
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat'
    }}
  />
);

export default PlusIcon;
